import React from "react";
import "antd/dist/antd.css";
import propTypes from "prop-types";
import AppLayout from "../components/applayout";

const _App = ({ Component }) => {
  return (
    <>
      <p>공통메뉴</p>
      <Component />;
    </>
  );
};

AppLayout.propTypes = {
  Component: propTypes.elementType.isRequired,
};

export default _App;
